{
  "translationLines": [
    {
      "lineNumber": 172941,
      "originalJapaneseLine": "　もう少し年月が必要だろう」",
      "translatedEnglishLine": "\"You'll need a little more time.\""
    },
    {
      "lineNumber": 172942,
      "originalJapaneseLine": "「シャリエラもう大人だよ？」",
      "translatedEnglishLine": "\"Shariera, you're already an adult, you know?\""
    },
    {
      "lineNumber": 172943,
      "originalJapaneseLine": "「体だけな。",
      "translatedEnglishLine": "\"Only in body."
    },
    {
      "lineNumber": 172944,
      "originalJapaneseLine": "　お前はまだ産まれたばかりの",
      "translatedEnglishLine": "You're still like"
    },
    {
      "lineNumber": 172945,
      "originalJapaneseLine": "　赤ん坊のようなものだよ」",
      "translatedEnglishLine": "a newborn baby.\""
    },
    {
      "lineNumber": 172946,
      "originalJapaneseLine": "「……マジか」",
      "translatedEnglishLine": "\"...Seriously?\""
    },
    {
      "lineNumber": 172947,
      "originalJapaneseLine": "「お前、ぐんぐん人間っぽくなってくな」",
      "translatedEnglishLine": "\"You're rapidly becoming more human-like.\""
    },
    {
      "lineNumber": 172948,
      "originalJapaneseLine": "「うわーん！　シャリエラー、もっと慰めてー！」",
      "translatedEnglishLine": "\"Waaah! Shariera, comfort me more!\""
    },
    {
      "lineNumber": 172949,
      "originalJapaneseLine": "「シャリエラ、ぐすっ、い、今まで、",
      "translatedEnglishLine": "\"Shariera, sniff, I-I'm sorry for everything until now..."
    },
    {
      "lineNumber": 172950,
      "originalJapaneseLine": "　ごめんね、ごめんね……ぐすっ……！」",
      "translatedEnglishLine": "I'm sorry, I'm sorry... sniff...!\""
    },
    {
      "lineNumber": 172951,
      "originalJapaneseLine": "「……抱きつくのはいいけど、",
      "translatedEnglishLine": "\"...It's fine to hug me,"
    },
    {
      "lineNumber": 172952,
      "originalJapaneseLine": "　脱げるから服、引っ張らないで」",
      "translatedEnglishLine": "but don't pull on my clothes, they'll come off.\""
    },
    {
      "lineNumber": 172953,
      "originalJapaneseLine": "「……なんか一気に騒がしくなったな」",
      "translatedEnglishLine": "\"...It's suddenly gotten noisy.\""
    },
    {
      "lineNumber": 172954,
      "originalJapaneseLine": "「しかし……",
      "translatedEnglishLine": "\"But..."
    },
    {
      "lineNumber": 172955,
      "originalJapaneseLine": "　腹が減ったな、何かないか？」",
      "translatedEnglishLine": "I'm hungry. Is there anything to eat?\""
    },
    {
      "lineNumber": 172956,
      "originalJapaneseLine": "「おにぎりはもう食べてしまいましたし……",
      "translatedEnglishLine": "\"We already ate the rice balls... "
    },
    {
      "lineNumber": 172957,
      "originalJapaneseLine": "　えとえと、何かあったかな……」",
      "translatedEnglishLine": "Umm, is there anything else...?\""
    },
    {
      "lineNumber": 172958,
      "originalJapaneseLine": "「あ、かつおぶしがありましたよ」",
      "translatedEnglishLine": "\"Ah, there's some bonito flakes.\""
    },
    {
      "lineNumber": 172959,
      "originalJapaneseLine": "「馬鹿、そんなの食えるか」",
      "translatedEnglishLine": "\"Idiot, who can eat that?\""
    },
    {
      "lineNumber": 172960,
      "originalJapaneseLine": "「じーー……」",
      "translatedEnglishLine": "\"Stare...\""
    },
    {
      "lineNumber": 172961,
      "originalJapaneseLine": "「あん？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 172962,
      "originalJapaneseLine": "「じーーーーーーーーーーーーーーーーーーーー",
      "translatedEnglishLine": "\"Staaaaaareeeeeeeeeeeeeeeeeeeeeee...\""
    },
    {
      "lineNumber": 172963,
      "originalJapaneseLine": "　ーーーーーーーーーーーーーーーーーーーーー",
      "translatedEnglishLine": "-----------------------------------------"
    },
    {
      "lineNumber": 172964,
      "originalJapaneseLine": "　ーーーーーーーーーーーーーーーーーーーーー",
      "translatedEnglishLine": "-----------------------------------------"
    },
    {
      "lineNumber": 172965,
      "originalJapaneseLine": "「うおっ！　ケイブニャン！」",
      "translatedEnglishLine": "\"Whoa! Cave-nyan!\""
    },
    {
      "lineNumber": 172966,
      "originalJapaneseLine": "「――と、ケイブワン？」",
      "translatedEnglishLine": "\"--and, Cave-wan?\""
    },
    {
      "lineNumber": 172967,
      "originalJapaneseLine": "「ひぐっ、ぐすっ……う゛う゛うぅう……」",
      "translatedEnglishLine": "\"Hic, sniff... ugh... ughhh...\""
    },
    {
      "lineNumber": 172968,
      "originalJapaneseLine": "「美味そうだにゃ……",
      "translatedEnglishLine": "\"Looks delicious nya..."
    },
    {
      "lineNumber": 172969,
      "originalJapaneseLine": "　かつおぶし……最高だにゃ……」",
      "translatedEnglishLine": "Bonito flakes... they're the best nya...\""
    },
    {
      "lineNumber": 172970,
      "originalJapaneseLine": "「それ、よこすにゃ」",
      "translatedEnglishLine": "\"Give it here nya.\""
    },
    {
      "lineNumber": 172971,
      "originalJapaneseLine": "「は？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 172972,
      "originalJapaneseLine": "「なにしてるにゃ。",
      "translatedEnglishLine": "\"What are you doing nya?"
    },
    {
      "lineNumber": 172973,
      "originalJapaneseLine": "　早くするにゃ」",
      "translatedEnglishLine": "Hurry up nya.\""
    },
    {
      "lineNumber": 172974,
      "originalJapaneseLine": "「ま、まあ、別にいいが……」",
      "translatedEnglishLine": "\"W-well, I guess it's okay...\""
    },
    {
      "lineNumber": 172975,
      "originalJapaneseLine": "勢いに気圧されたランスが",
      "translatedEnglishLine": "Overwhelmed by the momentum, Rance"
    },
    {
      "lineNumber": 172976,
      "originalJapaneseLine": "かつおぶしを差しだすと、",
      "translatedEnglishLine": "offered the bonito flakes,"
    },
    {
      "lineNumber": 172977,
      "originalJapaneseLine": "ケイブニャンがひったくった。",
      "translatedEnglishLine": "and Cave-nyan snatched them away."
    },
    {
      "lineNumber": 172978,
      "originalJapaneseLine": "「ばりぼり！　ぼりぼり！",
      "translatedEnglishLine": "\"Crunch crunch! Crunch crunch!"
    },
    {
      "lineNumber": 172979,
      "originalJapaneseLine": "　ふんっ、ふんっ、ふんっ！",
      "translatedEnglishLine": "Sniff sniff sniff!"
    },
    {
      "lineNumber": 172980,
      "originalJapaneseLine": "　あーっ！　かつおぶしは美味いにゃー！」",
      "translatedEnglishLine": "Ah! Bonito flakes are delicious nya!\""
    },
    {
      "lineNumber": 172981,
      "originalJapaneseLine": "「びえーーん！」",
      "translatedEnglishLine": "\"Waaaah!\""
    },
    {
      "lineNumber": 172982,
      "originalJapaneseLine": "「……なんなんだ、こいつら」",
      "translatedEnglishLine": "\"...What the hell are these guys?\""
    },
    {
      "lineNumber": 172983,
      "originalJapaneseLine": "「一目瞭然ではないか。",
      "translatedEnglishLine": "\"Isn't it obvious at first glance?"
    },
    {
      "lineNumber": 172984,
      "originalJapaneseLine": "　何か悲しいことがあったのだろう」",
      "translatedEnglishLine": "Something sad must have happened.\""
    },
    {
      "lineNumber": 172985,
      "originalJapaneseLine": "「何があった。",
      "translatedEnglishLine": "\"What happened?"
    },
    {
      "lineNumber": 172986,
      "originalJapaneseLine": "　話して聞かせてみろ」",
      "translatedEnglishLine": "Try telling me about it.\""
    },
    {
      "lineNumber": 172987,
      "originalJapaneseLine": "「ケイブリス様がとってもひどいにゃん！」",
      "translatedEnglishLine": "\"Lord Cave-lis was really awful nya!\""
    },
    {
      "lineNumber": 172988,
      "originalJapaneseLine": "「この忠実なニャン達にも暴言吐いたにゃん！",
      "translatedEnglishLine": "\"He even insulted us loyal Nyans!"
    },
    {
      "lineNumber": 172989,
      "originalJapaneseLine": "　ぷんぷん！」",
      "translatedEnglishLine": "Hmph!\""
    },
    {
      "lineNumber": 172990,
      "originalJapaneseLine": "「ニャンに対して役立たずだの、",
      "translatedEnglishLine": "\"He said we Nyans were useless,"
    },
    {
      "lineNumber": 172991,
      "originalJapaneseLine": "　本当は大嫌いだの、音痴だの、",
      "translatedEnglishLine": "that he really hates us, that we're tone-deaf,"
    },
    {
      "lineNumber": 172992,
      "originalJapaneseLine": "　いっぱいひどいこと言ったにゃん」",
      "translatedEnglishLine": "He said so many terrible things nya.\""
    },
    {
      "lineNumber": 172993,
      "originalJapaneseLine": "「ほんで？」",
      "translatedEnglishLine": "\"So?\""
    },
    {
      "lineNumber": 172994,
      "originalJapaneseLine": "「もう見捨てたの、嫌いになったの、",
      "translatedEnglishLine": "\"We've already abandoned him, hate him now,"
    },
    {
      "lineNumber": 172995,
      "originalJapaneseLine": "　もう知らない、ぷんぷん」",
      "translatedEnglishLine": "We don't care anymore, hmph!\""
    },
    {
      "lineNumber": 172996,
      "originalJapaneseLine": "ケイブニャンがバリバリと",
      "translatedEnglishLine": "Cave-nyan crunched"
    },
    {
      "lineNumber": 172997,
      "originalJapaneseLine": "かつおぶしを噛み砕いた。",
      "translatedEnglishLine": "the bonito flakes noisily."
    },
    {
      "lineNumber": 172998,
      "originalJapaneseLine": "「で、そっちは何をそんなに泣いとるのだ」",
      "translatedEnglishLine": "\"So, why are you crying so much over there?\""
    },
    {
      "lineNumber": 172999,
      "originalJapaneseLine": "「ぐす、ぐすっ……ケイブリス様……",
      "translatedEnglishLine": "\"Sniff, sniff... Lord Cave-lis..."
    },
    {
      "lineNumber": 173000,
      "originalJapaneseLine": "　本当はとっても優しい方わん……",
      "translatedEnglishLine": "He's actually a very kind person... wan...\""
    }
  ]
}

